import React from "react";

export default ({ green, text, data }) => {
  renderContent = () => {
      return (
        <div className={green? 'green-list' : 'red-list'}>
          <h5 className="no-margin">{text}</h5>
          <ul className="gray-background" style={{ margin: 0, padding: 0 }}>
            <li id="first-li">1st Mommy Chocolate Baby Chip</li>
            {data.map((cookie, id) => {
              if (id === 0) return;
              return <li>{cookie}</li>;
            })}
          </ul>
        </div>
      );
    }

  return renderContent();
};
